import React, { Component } from 'react';
import './App.css';
import TaskTable from './component/TaskTable';
import FilterList from './component/FilterList';

class App extends Component {
  render() {
    const {tasks} = this.props;

    return (
      <div className="App">
        <FilterList />>
        <TaskTable tasks = {tasks}/>
      </div>
    );
  }
}

export default App;
